import React, { Component } from 'react';
import 'flexboxgrid'
export default class ContactDetails extends Component {

    constructor(props) { 
        super(props);
    }

    goBack() {
        if (this.props.goBack) {
            this.props.goBack();
        }
    }

    render() {
        return (
            <div>
                <button onClick={ () => this.goBack() } ><span> Contacts </span></button>
                { this.props.selectedContact && 
                    <div class="row">
                        <div class="col-xs-12
                                    col-sm-8
                                    col-md-6
                                    col-lg-4">
                        <div class="box">
                        { this.props.selectedContact.largeImageURL}
                        { this.props.selectedContact.name }
                        { this.props.selectedContact.companyName }
                        </div>
                    </div>
                    </div>
                }
            </div>
        );
    }
}
